import React from "react";
const circle = { amount: 4, sign: "radio-button-off" };
const paw = { amount: 0, sign: "paw" };

class CatPath extends React.Component {
  renderList(circle, paw) {
    const type = circle > 0 ? circle : paw;
    const list = [];
    for (let i = 0; i < type.amount; i++) {
      list.push(<ion-icon name={type.sign} />);
    }
    return list;
  }
  render() {
    return (
      <div>
        <div>{this.renderList(circle.amount, 0)}</div>
      </div>
    );
  }
}

export default CatPath;
